// App.js
import React from 'react';
import VolunteerPoints from './components/VolunteerPoints';

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <h1>Volunteer Management System</h1>
            </header>
            <VolunteerPoints />
        </div>
    );
}

export default App;
